    private void restoreString() {
        total = 0;
        titulo = "";
        tipo = "";
        extra = "";
        listadoEjeX = new ArrayList<>();
        listadoEjeY = new ArrayDouble();
        listadoValores = new ArrayDouble();
        listadoEtiqueta = new ArrayList<>();
        listadoUnir = new ArrayOrderedPair();
        registrar[0] = true;
        registrar[2] = true;
        registrar[1] = true;
        tipoGrafica[0] = false;
        tipoGrafica[1] = false;
    }
